    <div>
      <h1>Test</h1>
      <p>Test Test Test</p>
      <ol>
        <li>Its a test</li>
        <li>Its a test</li>
        <li>Its a test</li>
      </ol>
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<MyInfo />);


